import axios from "axios";
import React, { useState, useEffect } from "react";
import { useParams } from "react-router-dom";
function ExampleOfPhonetic() {
  const { phonetic_name } = useParams();
  const { type } = useParams();
  const { REACT_APP_HOST } = process.env;
  const [PhoneticsExamples, SetPhoneticsExamples] = useState([]);
  const fetchData = async () => {
    try {
      const { data: response } = await axios.get(
        `${REACT_APP_HOST}getPhoneticExamples.php?phonetic_name=${phonetic_name}&type=${type}`
      );
      SetPhoneticsExamples(response);
      console.log('PhoneticsExamples',response);
    } catch (error) {
      console.error(error.message);
    }
  };

  useEffect(() => {
    fetchData();
  }, []);
  const PhoneticsList = Phonetics.map((phonetics, i) => {
    return (
      <>
        <div key={i} className="col-md-2">
          <Link
            to={`/phoneticssamples/${phonetics.name}`}
            className="button-50"
            role="button"
          >
            {phonetics.name}
          </Link>
        </div>
        <div className="custom-margin"></div>
      </>
    );
  });
  return (
    <div className="midde_cont">
      <div className="container-fluid">
       
      </div>
    </div>
  );
}
export default ExampleOfPhonetic;
